SELECT ?commonParty
WHERE {
  ?kennyParty <- <http://dbpedia.org/resource/Enda_Kenny> <http://dbpedia.org/ontology/party> ?partyKenny .
  ?electionLeader <- <http://dbpedia.org/resource/2005_Castlereagh_Borough_Council_election> <http://dbpedia.org/property/leader> ?electionLeaderParty .
  ?costelloParty <- <http://dbpedia.org/resource/Declan_Costello> <http://dbpedia.org/ontology/party> ?partyCostello .
  ?commonParty <- [?kennyParty, ?electionLeaderParty, ?partyCostello] UNION
  { ?commonParty <- ?kennyParty; FILTER (?partyKenny != ?electionLeaderParty) }
  { ?commonParty <- ?electionLeaderParty; FILTER (?electionLeaderParty != ?partyCostello) }
  { ?commonParty <- ?partyCostello; FILTER (?partyCostello != ?kennyParty) }
}
```

