PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#
PREFIX dbpedia: <http://dbpedia.org/>

// Query 1: Find the spouse of Leleiohoku I
SELECT ?spouse WHERE {
    <http://dbpedia.org/resource/Leleiohoku_I> <http://dbpedia.org/property/spouse> ?spouse .
}

// Query 2: Find the father of the spouse of Leleiohoku I
SELECT ?father WHERE {
    ?spouse <http://dbpedia.org/property/father> ?father .
}

// Query 3: Find the child of Kekūanāoʻa
SELECT ?child WHERE {
    <http://dbpedia.org/resource/Kekūanāoʻa> <http://dbpedia.org/ontology/child> ?child .
}

// Query 4: Find the parent of this child who is a royalty
SELECT ?parent WHERE {
    ?child <http://dbpedia.org/ontology/parent> ?parent .
    ?parent <http://dbpedia.org/ontology/Royalty> .
}

// Query 5: Find the child of Kamehameha IV
SELECT ?child WHERE {
    <http://dbpedia.org/resource/Kamehameha_IV> <http://dbpedia.org/property/child> ?child .
}

// Combine results to find the final answer
CONSTRUCT { 
    ?final_result <http://dbpedia.org/ontology/parent> ?parent . 
    ?parent a <http://dbpedia.org/ontology/Royalty> . 
    ?child1 <http://dbpedia.org/property/father> ?father_of_child1 . 
    ?child2 <http://dbpedia.org/property/father> "Kekūanāoʻa"@en
} WHERE {
    ?child1 <- query3 .
    ?parent <- query4 .
    ?child2 <- query5 .
    ?child1 <http://dbpedia.org/ontology/child> ?child2 .
    ?father_of_child1 <- query2 .
}
```

